		"text": "#올댓뮤직 #공개녹화\n200115 수요일 19:00 @춘천KBS공개홀\n⠀\n올댓뮤직 1월 15일 녹화\n뚜렷한 방향성을 가진 세 팀의 뮤지션과 함께합니다!\n⠀\n그 마지막 라인업🗣\n누구나 공감할 수 있는 이야기를 들려주는\n사랑스러운 알앤비 듀오 #위위 입니다😀 https://t.co/cQW5MfQS30"
