		"text": "함께 하면 겁날 것 없는 나우의 다섯 소녀들이\n요일별로 오색 매력 뿜뿜하며 제대로 '편'들어주는 시간💗\n오늘 밤 10시, 다섯 소녀들의 꽁냥꽁냥 첫 만남을 기대해주세요🥰\n#러블리즈 #지애 #여자친구 #은하 #오마이걸 #효정 #에이프릴 #나은 #우주소녀 #다영 #어벤걸스 #AVENGIRLS #NOW온에어 https://t.co/VeP4Wm2hvb"
